Red Riding Hood XXX (Ashlynn Brooke, Triple X Parody / 2010)

We all know her story, or so we thought.
What if Red Riding Hood had a naughty side? What if the Wolf was a sleazy, manipulative pervert that preyed upon innocent young girls? Get ready for the XXX version of one of the most epic fairy tales of all time - Red Riding Hood XXX. Young Red is off to visit grandma but Wolf has his eyes set on corrupting the little teen. Once Wolf gets grandma out of the picture, through the help of his sulrty assistant, he's finally able to have Red all to himself. The only catch is that Red is not quite as innocent as she looks.

Kristina Rose, Lexi Belle, Carolyn Reese, Magdalene St. Michaels, Juelz Ventura, Anthony Rosano, Danny Mountain, James Franco

Feature, Parody / Spoof

